      concern: "Gigi graham copot, tetapi masih ada ",
      treatment: "Melakukan pencabutan untuk gigi yang masih menempel",
    },
    {
      date: "22/10/2020",
      name: "Nandhika Pratama Putra",
      concern: "Gigi graham copot, tetapi masih ada sebagian yang menempel",
      treatment: "Melakukan pencabutan untuk gigi yang masih menempel",
